Concepts: java.security.spec.KeySpec A public or private key in the corresponding structured container format aka key spec. Keys can be specified by its components e.g. RSAPrivateKeySpec or its binary (DER encoding) e.g. PKCS8EncodedKeySpec and X509EncodedKeySpec. Other KeySpecs like OpenSSHPrivateKeySpec can be obtained from third-party libraries like Bouncy Castle. java.security.KeyFactory A factory method to generate private and public from KeySpec. Code: val keySpec = PKCS8EncodedKeySpec(Base64.getDecoder().decode("MIIEwAIBADANB..."))
val privateKey = KeyFactory.getInstance("RSA").generatePrivate(keySpec) Signature Given privateKey: PrivateKey, val privateSignature = Signature.getInstance("SHA256withRSA") privateSignature.initSign(privateKey) privateSignature.update("payload to encrypt".encodeToByteArray()) val signature = privateSignature.sign() byte[] publicBytes = Base64.decodeBase64(publicK);
X509EncodedKeySpec keySpec = new X509EncodedKeySpec(publicBytes);
KeyFactory keyFactory = KeyFactory.getInstance("RSA");
PublicKey pubKey = keyFactory.generatePublic(keySpec);
